import React from 'react'
import { Dialog, Button, Typography, DialogTitle } from '@material-ui/core'
import { BeachAccess } from '@material-ui/icons'

interface Props {
    title: string
    text: string
    handleClose: () => void
    open: boolean
}

export const SuccessDialog: React.FC<Props> = (props) => {

    return (
       <Dialog
        style={{padding: "16px"}}
        open={props.open}
        keepMounted
        onClose={props.handleClose}
        aria-labelledby="alert-dialog-slide-title"
        aria-describedby="alert-dialog-slide-description"
      >
        <BeachAccess />
        <DialogTitle style={{margin: "auto", width: "fit-content", padding: "8px"}} >{props.title}</DialogTitle>
        <Typography>{props.title}</Typography>
        <Typography>{props.text}</Typography>

        <Button variant={"text"} color="primary">schlie√üen</Button>
      </Dialog>
    )
}
